OacMessage::OacMessage(string message)
{
    this->content = message;
}

string OacMessage::get_content()
{
    return this->content;
}

string OacMessage::to_string(bool value)
{
    if(value)
    {
        return "true";
    }
    return "false";
}

string OacMessage::create_packet(string source, string target, int type, string body)
{
    string packet = "";
    packet.append("NEW_MESSAGE ");
    packet.append(source + " ");
    packet.append(target + " ");
    packet.append(lexical_cast<string>(type) + " ");
    int num_lines = std::count(body.begin(), body.end(), '\n');
    packet.append(lexical_cast<string>(num_lines) + "\n");
    packet.append(body);
    packet.append("\n");
    return packet;
}

OacMessage OacMessage::unknown_message_1()
{
    boost::uuids::uuid uuid = boost::uuids::random_generator()();
    string time = OacMessage::get_current_timestamp();

    string message = "";
    message.append("<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n");
    message.append("<oc:embodiment-msg xsi:schemaLocation=\"http://www.opencog.org/brain BrainProxyAxon.xsd\" xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xmlns:oc=\"http://www.opencog.org/brain\">\n");
    message.append("<avatar-signal id=\"\" timestamp=\"" + time + "\">\n");
    message.append("</oc:embodiment-msg>\n");

    string packet = OacMessage::create_packet(lexical_cast<string>(uuid), "", MessageType::STRING, message);
    OacMessage msg(packet);
    return msg;
}

